import * as React from "react";
import { RestaurantState } from "./../../typing/data";
import {
	ALlDetail,
	TextDetail,
	Button,
	PlainText,
} from "../../container/style";
import Slider from "react-slick";

interface IItemLIst {
	data: RestaurantState;
}

const ItemList: React.FC<IItemLIst> = (props) => {
	console.log("data", props.data);
	var settings = {
		dots: true,
		arrows: true,
	};
	return (
		<>
			<ALlDetail>
				<Slider {...settings}>
					<div>
						<img src={props.data.img} width="250"  />
					</div>
					<div>
						<img src={props.data.img} width="250"  />
					</div>
					<div>
						<img src={props.data.img} width="250"  />
					</div>
					<div>
						<img src={props.data.img} width="250"  />
					</div>
				</Slider>
				{/* <img
					src={props.data.img}
					alt={props.data.name}
					width="230"
					// height="600"
				/> */}
				<p>{props.data.name}</p>

				<TextDetail>
					<PlainText>Total Queue</PlainText>
					<PlainText>{props.data.people}</PlainText>
				</TextDetail>
				<TextDetail>
					<PlainText>Free Queue</PlainText>
					<PlainText>{props.data.people}</PlainText>
				</TextDetail>
				<Button>Booking</Button>
			</ALlDetail>
		</>
	);
};
export default ItemList;
